1060	1.\tPor volta das 07h, após acionada pela CICOM, a Gu do 1º Pel-Guanambi/1ª Cia, comandada pelo Sd Modesto, compareceu a Rua Dom Pedro II, Vila Nova, Guanambi para verificar informação de um Beta 21, constatando que o Ford/Jeep, PKO-2380,\npreto, conduzido pelo Sr. Jackson Pereira Baleeiro Neto, residente na rua Roudão da Cunha Viana, 283, Pôr do Sol, Guanambi havia perdido a direção e se chocado no muro de uma residência. O proprietário se comprometeu a reparar o dano.\n2.\tPor volta das 09h40, a Gu do 3º Pel/Iuiu-4ª Cia, comandada pelo Cb Machado, foi informada que dois indivíduos portando arma de fogo subtraíram, de Gileno Pereira dos Santos, a Honda/CG 150 Titan KS, NKD-0784/Iuiu-BA, na estrada do distrito de Pindorama/Iuiu, sendo que às 13h35 o Sgt RR Paulo César que, juntamente com a vítima e seu patrão, Erivardes, encontraram a moto abandonada na Faz do Sr Lauro em Pindorama. Os suspeitos não foram localizados.\n3.\tPor volta das 11h30, após denúncia anônima recebida pela CICOM informando intenso tráfico de drogas Rua Lajedão, Monte Pascoal, em Guanambi, as Gu’s do Coordenador de Área, a CETO B e da 1° CIA, comandadas pelo Ten PM Diogo Éder, Cb PM Cristiano e Cb PM Anderson, compareceram ao local quando um indivíduo empreendeu fuga, entrando em sua residência encontramos diversos materiais ilícitos. O infrator de nome o menor Israel Roberto da Silva, 17 anos (14/12/2002), estava em posse de algumas buchas de maconha. Em busca na residência foi encontrada 63 (sessenta e três) pedras de substância análoga ao crack, 62 (sessenta e duas) trouxinhas e 1 (uma) porção grande de substância análoga à maconha totalizando 156g (cento e cinquenta e seis gramas), 1 (um) Samsung J2, R$ 791 (setecentos e noventa e um reais), 1 (uma) faca e diversas embalagens usadas para acondicionar drogas escondidos em várias partes do imóvel. O menor assumiu ser o dono do material, disse que adquiriu em Bom Jesus da Lapa e que comercializa a droga. A irmã, Maria Carol da Silva, acompanhou o menor até a DT onde a ocorrência foi registrada sob nº 4352/20.\n4.\tPor volta das 20h, a Gu do 1º Pel/Mutans-Guanambi/2ª Cia, comandada pela Sgt Dorizângela, acionada por populares, deslocou até o Bar de Leomar para verificar uma briga. No local souberam que Genário Nogueira, residente na Rua Guaranésia, e Daniel, residente na Faz Minador, discutiram por conta de Lucivaldo Ramos Silva, chegando o primeiro a agredir o segundo e ainda tentado acertá-lo com um facão. Como não conseguiu alcançá-lo, danificou o pára-brisas traseiro e o vidro da porta do lado do motorista do veículo VW/Paraty, placa final 0630/Palmas de Monte Alto-BA, pertencente a Genário. Daniel evadiu do local.\n5.\tPor volta de 21h30, a Gu do 1º Pel-Candiba/5ª Cia, comandada pela Cb Vera, apresentou, na DT/Guanambi BO 04353/20, Vandilson Gonzaga de Souza, 29 anos, residente na Rua M, 120, Vila Neves, Candiba, por ameaça a familiares, entre eles, sua mãe Maria do Carmo, e anificado vários móveis e eletrodomésticos da residência.\n6.\tPor volta das 21h55, a Gu do 1º Pel/Mutans-Guanambi/2ª Cia, foi informada que Lucivaldo Ramos Silva estava causando confusão na lanchonete Ronne Lanches. Abordado no local, Lucivaldo desacatou a Gu e disse que não entraria na Vtr, mas foi convencido, conduzido e apresentado na DT/Guanambi sob BO 20-04354.\n7.\tPor volta das 23h30, a Gu do 3º Pel-Matina/4ª Cia, após informação de populares de que Fábio Batista Magalhães, residente na Tv do Cemitério, 37, Centro, Matina, ameaçava participantes de um evento político com uma faca, realizou rondas, mas não localizou o suspeito, ocasião em que soube que um rapaz chamado Eduardo havia sido atingido no pescoço e que o Sgt Marinho, que se estava de folga, prendeu o agressor que havia tentado agredi-lo, porém, durante a imobilização, um VW/Gol, prata passou sobre a perna de Fábio e evadiu. Os PMs acionaram o SAMU que prestou socorro à vítima do atropelamento conduzindo-a ao hospital municipal e saíram em busca do condutor, Jadson Caio Reis Cotrim, porém não o localizaram\n8.\tPor volta de 01h40min, a Gu da CETO-Guanambi, prendeu Josilene Rodrigues da Silva, 19 anos, na Rua Djalma Mota, Beija-flor,Página 2 de 2 por desacato, sendo apresentado na DT/Guanambi, BO 4355/20.\n9.\tOPOs: Foram cumpridas as seguintes OPOs: alfa 16/18 na UPA, HGG, B Brasil, Correios, Pr Feijão, Área Comercial, Op Força Tática e Varredura; eventos eleitorais em Guanambi, Seb Laranjeiras, Palmas M Alto, Carinhanha, Iuiu, Candiba, Malhada, Urandi.	2020-11-07 10:20:17.783+00	2020-11-08 10:22:56.593+00	2020-11-08 10:22:56.593+00	31	2	31	7	2911709	1	t	\N	\N	
